    arr = [0] / (n + 1)
    brr = [0] * (m + 1)
    for i in range(1, n + 1):
        arr[i] = a[i - 1] + arr[i - 1]
    for i in range(1, m + 1):
        brr[i] = b[i - 1] + brr[i - 1]
    ans = 0
    for f in range(1, int(k ** 0.5) + 1):
        if k % f == 0:
            x = f
            y = k // f
            if y <= m:
                cc = 0
                for i in range(n + 1):
                    if i + x > n:
                        break
                    if arr[i + x] - arr[i] == x:
                        cc += 1
                bb = 0
                for i in range(m + 1):
                    if i + y > m:
                        break
                    if brr[i + y] - brr[i] == y:
                        bb += 1
                ans += cc * bb
            if x != y:
                y = f
